description:
Rattaché(e) au département Produit du Groupe SeLoger, vous serez responsable de l'expérience utilisateur pour les sites spécialisés dans l'immobilier professionnel et de luxe (Agorabiz et Belles Demeures…) . Votre mission sera de concevoir des interfaces web et mobile centrées sur les utilisateurs, afin d'optimiser les usages et la conversion.

Vos responsabilités au quotidien :
Conduire la Recherche Utilisateur et réaliser une Veille Marché, afin de cartographier l?expérience (Empathy Map, Customer Journey Map,…) et d'enrichir les Personas ;

Imaginer des parcours utilisateurs optimisés répondant aux différents profils et contextes d'usage dans une approche multi-devices ;

Piloter les ateliers nécessaires à votre démarche UX (idéation, co-conception, tri par carte, etc.), avec nos utilisateurs ou des collaborateurs d'autres équipes ;

Organiser, conduire et analyser les tests utilisateurs à l'aide des prototypes que vous aurez créés ;

Travailler en étroite collaboration avec le Product Manager et les Développeurs afin de proposer des solutions intuitives et lean ;

Être force de proposition au quotidien, afin d?améliorer de façon continue nos sites et services.

…Et s'il fallait encore vous convaincre, voici le top 3 des raisons pour lesquelles vous aimerez travailler chez nous !

1. Vous aurez un vrai impact, en simplifiant la vie des millions de français qui ont un projet immobilier ;

2. L'immobilier est un marché dynamique, sur lequel SeLoger est leader et innove constamment ;

3. Le cadre de travail est top : une équipe sympa et bienveillante, et des bureaux chouettes situés à Paris.

Si ce challenge vous intéresse, nous avons hâte de vous rencontrer ! : -)
Profil recherché De formation Bac + 4/5, vous justifiez d?au moins 5 ans d?expérience professionnelle en tant qu'UX Designer en agence ou chez un pure player ;

Véritable passionné(e) du Digital et de l'expérience utilisateur, vous faites preuve de créativité, d'empathie, de curiosité et de réactivité ;

Vous avez à cœur de procurer aux utilisateurs finaux des expériences qui leur simplifient la vie. Vous êtes aussi minutieux(se) et rigoureux(se) car vous savez que ce sont aussi les détails qui font toute la différence pour le succès d'un produit !

Vous accordez autant d?importance à l'architecture de l?information ou au choix des composants d?interface qu'aux mots qui les accompagnent ;

Votre capacité d'analyse et de communication vous permet de travailler en équipe pluridisciplinaire et de comprendre les contraintes inhérentes aux différents corps de métiers impliqués dans la conception (marketing, IT, commercial, …) ;

Vous maîtrisez plusieurs outils de conception de wireframes et prototypes (Sketch, Invision, Marvel, etc.).

Vous êtes organisé(e) et savez jongler entre différents projets/différentes deadlines ;

Vous avez un bon niveau d?anglais, afin de réaliser votre veille, mais aussi de pouvoir échanger avec vos pairs du Groupe Axel Springer qui travaillent sur les mêmes problématiques que vous dans d'autres régions du monde !

Nos utilisateurs et nos clients sont notre priorité. Si vous avez très envie d?être une pièce maîtresse dans la refonte continue de nos sites, si vous souhaitez aider les gens à trouver plus facilement la maison ou l?appartement de leur rêve, alors n?attendez plus, postulez et rejoignez nos équipes !

Bureaux situés à Paris. Rémunération motivante : Fixe sur 12 mois + variable + participation + intéressement
Entreprise Rejoindre SeLoger, c'est pousser les portes d'une grande maison de + 6 000 m². Chaque étage met en valeur une pièce typique de la maison, un espace de vie dans lequel chacun trouve aisément sa place. Ici pas de profils types mais une richesse de collaborateurs d'au moins 20 ans de tout horizon avec de fortes compétences digitales. Chacun vit avec passion et enthousiasme l'expérience collaborateur SeLoger. Une aventure épanouissante et inspirante portée par une culture d'entreprise où il fait bon vivre, où les talents se développent, où les temps conviviaux se partagent et où les individualités s'expriment. Pour entrer dans la maison, quelques règles de vie sont à respecter : combativité, agilité, innovation et respect de l'autre sont les maîtres mots.

Nous recherchons aujourd’hui un(e) développeur(se) Front End pour intégrer une équipe produit en vue pour un stage de pré-embauche.
En collaboration avec une UX/UI designer, le/la Développeur(se) Front-end aura pour mission de :
Migrer les fonctionnalités de l’outil actuel vers la nouvelle plateforme ;
Développer de nouvelles fonctionnalités (conception, développement, testing) ;
Garantir la meilleure expérience utilisateur en assurant une amélioration permanente des process ;
Contribuer à l’architecture du produit, aux revues de code, et à la qualité et stabilité du produit dans son ensemble ;
Collaborer de manière active avec l’ensemble des membres de la team produit.
Le/La Développeur(se) Front-end interviendra sur la stack technique suivante :
React JS 16.8 (intégration des hooks) ;
Typescript ;
GraphQL Apollo Client ;
Material UI ;
API GraphQL codé en Ruby on rails
LES PLUS
De beaux locaux en plein centre de Paris (11e)
Une équipe jeune et dynamique (moyenne d’âge aux alentours de 27 ans)
La possibilités de travailler avec de nombreuses personnes aux profils très variés
Un open bar chaque mois dans la brasserie artisanale la plus stylée de Paris
Petit déjeuner tous les vendredis, paniers de fruits bio et terrain de pétanque
Tickets resto, et titres de transport remboursé à 50%, 1/2 congés payé par mois
Profil recherché
Expérience en dev web avec des frameworks Javascript
Une expérience avec des librairies de type ReactJS, Angular ou VueJS est un plus

Alain Bensoussan Avocats Lexing, cabinet d’avocats spécialisés dans tous les secteurs des technologies avancées et précurseur de la théorie de la personnalité juridique des robots, recherche un développeur web (H/F) full stack.
Rejoindre le cabinet, c’est intégrer une structure qui a su durablement s’installer à la première place des cabinets spécialisés en technologies de l’information, informatique, internet et télécoms, pas sa taille, ses effectifs, l’originalité de son modèle, son activité et sa notoriété.
C’est aussi partager nos valeurs basées sur le travail d’équipe, l’entraide, le partage des connaissances dans le respect de chacun.
De formation informatique, vous avez une expérience d’au moins deux ans et vous maîtrisez les technologies :
PHP,
Angular 2 ou supérieur ;
MySQL ;
API RESTful ;
CSS3, SCSS ;
Material Design ;
Connaissances de C#, Docker et Microsoft SQL Server sont un plus ;
Vous serez impliqué(e) dans les étapes de conception et de développement, vous réaliserez de nouveaux modules et participerez aux étapes du cycle de validation (conception, développement, tests, validation et support aux utilisateurs).
Vous prendrez en charge les projets dans leur totalité.
Vous êtes dynamique, proactif, vous avez un bon relationnel et une grande capacité d’adaptation, vous aimez le travail en équipe.
Vous voulez partager notre politique du «Stress cool » qui favorise le développement personnel, l’augmentation des connaissances et des performances dont le résultat est la réalisation de produits de très haute compétence.
Type d'emploi : CDI
Expérience:
développeur web full stack (h/f) ou similaire: 1 an (Souhaité)
Lieu:
Paris (Requis)

Store & Supply accompagne une vingtaine de marques de mode et autres dans leur développement e-commerce. Nous prenons en charge l'intégralité de la stratégie e-commerce (gestion e-commerce, web-marketing, CRM et marketplaces).
Start-up en pleine croissance, nous sommes actuellement à la recherche de nouveaux talents souhaitant prendre part à notre développement.

Poste basé à Paris (17).
Description du poste
Tu es talentueux, dynamique, motivé et tu as pleins de choses à raconter ?
Alors tentes ta chance pour rejoindre notre équipe en pleine croissance afin de nous aider sur le développement e-commerce d'une vingtaine de marques.

Avec l'aide et l'expertise de notre chef de projet/webdesigner qui sera là pour te montrer la voie, tes principales missions seront :
la création de visuels (desktop/mobile) pour les homepages de nos sites ;
la création de maquettes afin d'améliorer l'expérience utilisateur ;
participer à la gestion des projets de développement et d’optimisation des e-shop (merchandising et ergonomie) en collaboration avec notre équipe de développeurs (communication en anglais) ;
le suivi et l'intégration des catalogues produits ;
le contrôle de l’offre et le bon fonctionnement des sites.

Quelques infos utiles :
La période du stage doit être de 4 à 6 mois minimum.
Nos locaux sont situés au 141, avenue de Wagram 75017 Paris. (métro Wagram)
Profil recherché
Nous aimerions que tu sois avant tout créatif, enthousiaste, autonome, et surtout motivé, que tu es au minimum 2 ans d'expériences et que ton parcours t'ai amené ici par le biais de t'as motivation, ton talent et ton envie de travailler dans le digital car c'est un milieu quand même beaucoup trop stylé ;-)

Tu es :
curieux, tu t'intéresses au e-commerce et tu maintiens une veille sur les nouvelles tendances ;
content de rejoindre une équipe jeune en pleine croissance et pleine de talents ;
doté d'un œil graphique, tu sais mettre en œuvre toutes tes idées créatives ;
doté de bonnes maîtrises techniques sur :
Photoshop (sinon ça va être compliqué)
Sketch, Adobe XD (pour faire des maquettes web au top !)
Prestashop (notre CMS utilisé sur la majeure partie de nos clients)
les langages web de base HTML et CSS (inspecter une page web n'a plus de secret pour toi)
Excel (allez rien qu'un petit peu ça te sera utile) ;
rigoureux, logique et impliqué dans ton travail ;
capable de dialoguer en anglais sans trop de difficulté et sans passer ton temps sur Google Trad ?

Alors tu vois c'est facile, rejoins-nous dans notre belle aventure et deviens notre futur(e) stagiaire ;-)

Nous recherchons un Développeur Sénior H/F possédant une bonne pratique de l'intégration SalesForce avec des Systèmes d'information externes et la gestion de projet. D'un naturel communiquant, vous aimez échanger avec les autres membres de l'équipe constituée de six personnes en Recherche & Développement.

A ce titre vos principales missions seront les suivantes:
Participer à la rédaction des spécifications détaillées et veiller aux choix technologiques;
Etre force de propositions techniques afin d'améliorer la plateforme logicielle;
Démontrer une certaine aisance dans la communication écrite, et être capable de réaliser des schémas techniques clairs et compréhensibles;
Etre autonome, créatif et avoir le sens de la qualité logicielle.
Profil recherché Issu(e) d'une formation supérieure de niveau Bac+5 minimum en informatique, vous disposez d'une expérience réussie d'au moins 5 ans sur une mission similaire.

Votre profil :
Bonne communication tant à l'oral qu'à l'écrit;
Un bon esprit de synthèse et d'analyse;
De bonnes compétences techniques notamment en infrastructure WEB;
Une bonne maîtrise des outils bureautique et de travail collaboratif;
Langages et technologies:
Intégration SalesForce;
JAVA (J2EE);
Bases de données MySql;
Ensemble de services basés sur AJAX (format JSON, XML, etc.);
Apache/Tomcat;
La connaissance de JASPER est un plus.
Entreprise Fondé en 2007, présent à Paris, Nantes, Lyon, Bordeaux et à Luxembourg, le cabinet FAB Group (www.fab-group.fr) est articulé autour de 6 marques : Carrières Bancaires (Banque de détail et Services financiers spécialisés), Carrières Financières (Finance d'entreprise et Comptabilité), Carrières Assurances (Assurance), FAB Real Estate (Immobilier), FAB Careers IT (IT) et FAB Careers (Banque Privée, Banque d'Investissement et de Financement, Gestion d'Actifs, Finance de Marché, Private Equity, ...).

FAB Careers IT est aujourd'hui la marque dédiée au recrutement des talents dans le domaine de l'IT dans le secteur financier et mutualiste. FAB Careers IT recherche pour une société de courtage en Assurances, un Intégrateur SalesForce/ Développeur Java H/F, à Paris (75).

Dans le cadre de votre mission au sein de l'équipe MOA-MOE / Support / Tests d'intégration (4 personnes), vous êtes garant de la qualité des livrables applicatifs.

A ce titre, vos principales missions seront les suivantes :
Assurer l'adéquation des livrables informatiques vis-à-vis des spécifications;
Préparation/validation des plans de tests;
Rédiger et exécuter les cas de tests en utilisant les outils adéquats et avec une forte vision client;
Vérifier la cohérence et la qualité des WebServices et autres API techniques mises à disposition par l'équipe R&D;
Assurer des tests de non-régression;
Mettre en place des tests automatisés dans une logique d'optimisation de la productivité;
Support de niveau 2, traitement des demandes pour lesquelles vous posez un diagnostic, le cas échéant, transfert de l'incident à l'équipe R&D;
Coordonner les différents intervenants (développeurs, architectes, ingénieurs système) pour la réalisation des mises en production;
Vos compétences techniques vous permettent d'échanger avec l'équipe R&D;
Vous intervenez en tant qu'expert de la plateforme.
Profil recherché De formation supérieure (BAC+3, BAC+5), vous avez 3 ans minimum d' expérience sur un poste d'ingénieur Q&A ou équivalent

Vous disposez d'une bonne communication tant à l'oral qu'à l'écrit, e t d'un bon esprit de synthèse et d'analyse.

Vous avez également de bonnes compétences techniques notamment en infrastructure WEB.

Vous maîtrisez les outils techniques qui vous permettent de rechercher les origines des incidents sur les environnements d'exploitation.

Une connaissance du métier de l'assurance vie est un plus.

L'environnement technique est le suivant:
Jenkins;
JIRA, Confluence, Selenium, SoapUI, Restlet, Postman;
Apache, Tomcat, MySql;
Windows.
Entreprise Fondé en 2007, présent à Paris, Nantes, Lyon, Bordeaux et à Luxembourg, le cabinet FAB Group (www.fab-group.fr) est articulé autour de 6 marques : Carrières Bancaires (Banque de détail et Services financiers spécialisés), Carrières Financières (Finance d'entreprise et Comptabilité), Carrières Assurances (Assurance), FAB Real Estate (Immobilier), FAB Careers IT (IT) et FAB Careers (Banque Privée, Banque d'Investissement et de Financement, Gestion d'Actifs, Finance de Marché, Private Equity, ...).

FAB Careers IT est aujourd'hui la marque dédiée au recrutement des talents dans le domaine de l'IT dans le secteur financier.

FAB Careers IT recherche pour l'un de ses clients, société de courtage en Assurances, leader sur son marché et disposant d'une excellente image auprès de sa clientèle, un Ingénieur Q&A H/F, à Paris (75).

Rattaché(e) au département Produit du Groupe, vous serez responsable de la conception des interfaces des sites et applications de Logic Immo. Nous avons à cœur de créer des services qui répondent aux besoins de nos utilisateurs et de nos clients. Votre mission sera donc d?améliorer leur quotidien, grâce à des interfaces simples et fluides.

Vos responsabilités au quotidien :
Imaginer nos futurs services en collaboration avec l?UX Designer et le Product Manager ;

Concevoir les interfaces responsives qui leur donneront vie sur mobile, tablette et desktop, grâce à l?utilisation de notre Design System ;

Être force de proposition pour faire évoluer ces guidelines créatives, dans le respect de notre territoire de Marque ;

Réaliser la recette graphique de vos interfaces avec nos équipes de développement, afin de vous assurer de la qualité de ce que verront nos utilisateurs ;

Réaliser une veille constante sur les tendances web design (codes graphiques, animations, micro-interactions, etc.) et diffuser cette culture au sein de l?entreprise.

…Et s?il fallait encore vous convaincre, voici le top 3 des raisons pour lesquelles vous aimerez travailler chez nous !

1. Vous aurez un vrai impact, en simplifiant la vie des millions de français qui ont un projet immobilier ;

2. L?immobilier est un marché dynamique, sur lequel Logic Immo innove constamment ;

3. Le cadre de travail est top : une équipe sympa et bienveillante, et des bureaux chouettes situés à Paris.

La qualité de votre travail est plus importante pour nous que votre CV ou votre nombre d?années d?expériences : lors de votre candidature, merci de joindre votre Book ou un lien vers une version en ligne. Il est la meilleure démonstration de votre expertise !
Profil recherché De formation supérieure en Design / Communication Visuelle, vous possédez une expérience aboutie dans le domaine du web, en agence ou chez un pure player ;

Vous êtes minutieux(se) et rigoureux(se) car vous savez que ce sont aussi les détails ou micro-interactions qui font toute la différence pour le succès d?un produit !

Vous aimez travailler en équipe, que ce soit avec vos pairs (UI Designers) ou plus globalement l?ensemble des métiers qui vous entourent (UX Designer,

Product Manager, Développeurs, etc.) ;

Vous êtes un utilisateur avancé de Sketch (utilisation des librairies partagées, etc.), mais aussi d?Illustrator et Photoshop

Vous êtes organisé(e) et savez jongler entre différents projets/différentes deadlines ;

La maîtrise de l?anglais est un plus, et vous permettra d?échanger avec d?autres collaborateurs du Groupe Axel Springer dans le monde!
Entreprise Depuis 23 ans, Logic-Immo.com accompagne les futurs acquéreurs et les locataires dans la recherche de leur futur bien. Une longévité due à sa capacité d'innover qui lui permet de se réinventer sans cesse pour aider les acteurs du marché à anticiper la recherche immobilière de demain. Pluri-média (magazine, portail web, application mobile et tablette) à forte notoriété au niveau national, Logic-Immo.com offre à ses utilisateurs un panorama complet avec plus d'un million d'annonces de biens disponibles proposées par les professionnels. Ses médias digitaux affichent un fort développement et comptent plus de 15 millions de visites mensuelles, avec un accent particulier sur le mobile.

Nous recrutons un développeur Full stack, Javascript ou angular etJava JEE.
Missions du développeur full stack Javascript ou angular et Java JEE :
Participation au développement ainsi qu'à l’architecture de la plateforme;
Mise en place de contrôles qualités à l’aide de différents tests ;
Evolution au sein d’un mode de fonctionnement agile scrum ;
Développement de solutions et d’applications web.
Profil du développeur full stack Javascript ou angular et Java JEE :
Vous avez de l'expérience sur Angular ;
Vous êtes à l’aise dans un environnement AWS ;
Vous connaissez des outils de conception comme Swagger, UML, CQRS ;
SI vous avez des prés-requis sur Docker, EMR et Kubernetes, c’est un plus ;
Vous êtes à l’aise sur Java 8.
Type d'emploi : Temps plein, CDI
Expérience:
développeur full stack javascript ou angular et java jee h/f ou similaire: 1 an (Souhaité)
Langue:
Anglais (Souhaité)
Français (Requis)

Nous recrutons un développeur Front-end (Angular ou Vue) H/F dès que possible pour un client final basé à Londres. C'est un poste en CDI. Les locaux sont basés à Londres, le télétravail est possible.
Missions Développeur frontend Senior (Angular / Vue.js) :
Collaborer avec l’équipe dans un environnement agile;
Effectuer des examens et des essais réguliers des codes;
Travailler à la reconstruction du côté client dans une nouvelle technologie;
Développer la valeur réelle de l’entreprise;
S’attaquer aux nouvelles innovations, de la conception à l’exploitation;
Reconnaître et expliquer pourquoi une conception est erronée ou non;
Responsable du développement des fonctions de base de la plate-forme Cloud;
Connaître, se renseigner et travailler avec les dernières technologies.
Votre profil frontend Developer (Angular / Vue.js) :
Vous aimez travailler autour des nouvelles technologies;
Vous avez au moins 3 mois d'expérience ;
Vous êtes motivé et enthousiaste ;
Vous êtes méticuleux ;
Vous avez de l’expérience dans les techniques de construction Web ou les applications de bureau complexes ;
Vous connaissez JavaScript /ES6/typescript HTML 5, CCS 3, la sécurité des applications Web, le développement axé sur les tests, les problèmes de navigation croisée, Vue.js et/ou AngularJS ;
Connaissances supplémentaires : SCSS / LESS, WebRTC, Accessibilité Web, Git / Bitbucket, MySQL, Connaissance des protocoles de diffusion vidéo en continu, Diplôme universitaire, WebSocket ;
Type d'emploi : Temps plein, CDI
Expérience:
ingénieur backend ruby junior h/f ou similaire: 1 an (Souhaité)
Langue:
Anglais (Souhaité)
Français (Requis)

Vous êtes un développeur .NET expérimenté, à la recherche d’un nouveau challenge dans une équipe internationale, vous voulez avoir un réel impact dans un groupe international et vous développer par la même occasion… alors nous sommes faits pour nous entendre !

Ce poste est basé à Paris avec des déplacements occasionnels dans nos bureaux d’Amsterdam et de Bergen (Norvège).

Votre mission :
En rejoignant notre équipe parisienne, vous contribuerez à l’innovation et au développement du Photo Organiser du groupe albelli. Vous interviendrez sur les micro services, le modèle de données graph, les APIs et ses interfaces. Votre objectif sera de rendre l’expérience client le plus agréable et le simple possible ; de l’upload des photos jusqu’à la création des produits. Vous ajouterez des fonctionnalités innovantes et vous maintiendrez l’existant.

Ah oui vous serez aussi responsable de plus de 800 millions d’images !

Vous rejoindrez une équipe Agile pluridisciplinaire localisée à Paris, Amsterdam et Bergen.

Vos principales responsabilités :
Designer, développer, tester et délivrer les nouvelles fonctionnalités du Photo Organiser ;

Proposer des améliorations dans notre façon de travailler en équipe ;

Partager vos compétences avec vos collègues au travers des sprint reviews, de séances de pair programming, des dev days etc ;

Vous aurez l’opportunité d’avoir un réel impact sur l’organisation de l’équipe, en travaillant notamment sur notre pipeline de test ;

Vous implémenterez les fonctionnalités décrites par nos Stakeholders mais vous apporterez également vos idées dans le backlog ;

Améliorer notre service de Storage ;

Améliorer notre infrastructure en ajoutant de nouveaux micro services ;

Migrer des micro services vers .NET Core ;

Tech keywords: .NET Core, C#, AWS, Serverless, Lambda, Micro Services, , Neo4J Graph Database, REST API

Nous offrons :
La liberté d’expérimenter les dernières technologies ;

Un contexte e-commerce à la pointe de la technologie sur des problématiques majeures en termes de charge, de stockage et de performances ;

Des bureaux Parisiens très agréables avec tous les avantages de WeWork ;

Une culture internationale et des bureaux à Amsterdam et Bergen ;

Une ambiance informelle, fun et détendue ;

Compensation compétitive, aide à la relocalisation et de nombreux autres avantages.
Profil recherché Vous avez plus de 5 ans d’expérience en tant qu’ingénieur de développement ;

Un excellent niveau en C# et très bonne connaissance de la plateforme .NET ;

De solide expériences des technologies Web Microsoft (ASP.NET MVC or Web API);

Une très bonne expérience des tests unitaires et d’intégrations ;

Une expérience avec les bases relationnelles et un framework ORM ;

Vous avez un anglais courant à l'oral et à l’écrit.

Idéalement, vous avez une expérience sur des plateformes e-commerce en contact direct avec les clients ;

Connaissance des cloud providers, AWS idéalement ; connaissance de plusieurs autres langages ; Expérience de Continuous Delivery, TDD, BDD, DDD ; Expérience avec une base de données graph, idéalement Neo4J.
Entreprise Créé en 2004, monAlbumPhoto.fr est le pionner de l'impression de produits photo personnalisés sur internet.

Son site de production basé dans l’Oise et une maîtrise totale de la chaine de production permet d'être un des leaders dans son domaine. Aujourd'hui, ce sont près de 150 collaborateurs au plus fort de l'année, qui réalisent les rêves de nos clients, générant un CA de 30 millions d’euros.

Grâce à notre excellence opérationnelle d'e-commerçant, notre rythme d’innovation et notre maîtrise de la chaîne de production nous avons imprimé plusieurs dizaines de millions de photos. Nous offrons à nos clients la possibilité de personnaliser une gamme variée de produits.

monAlbumPhoto a rejoint en juillet 2018 le groupe hollandais Albelli, l’un des leaders européens dans notre secteur d’activité.

Vous souhaitez parfaire vos connaissances en frontend, être formé.e et relever un nouveau défi ?
Embarquement immédiat pour un projet from scratch e-commerce, en plein Paris.

Au sein d’une équipe de 5 personnes dont 3 développeurs, vous apporterez votre expertise et votre détermination pour participer au développement d’un projet à grande visibilité et à fort trafic.

Quelques exemples des tâches qui composeront votre mission :
Réflexion autour de l’architecture technique ;
Conception des développements en front-end ;
Développement des fonctionnalités métiers ;
Refactoring de code (qui est très challengeant !) ;
Interaction avec différents web services ;
Coordination avec les groupes de travail côté back-end.

Contexte du projet :
Respect des bonnes pratiques du développement conformément à l’approche clean code !
Principes de l’agilité avec fonctionnement en cycle court : sprint de 2 semaines avec réunions de début et de fin de sprint.

PROFIL :
Fan de frontend, de software craftsmanship et d’agilité ? Vous aimeriez explorer les nouvelles technologies Javascript et vous tenir au courant des nouvelles sorties (Angular, ReactJS) ?
Diplômé.e d’une école d’Ingénieur ou équivalent, vous possédez déjà un solide socle technique et vous êtes sensible aux technologies du web.

POURQUOI Nous rejoindre ?

Un parcours de formation sur mesure : tutorat et coaching, dojos et accompagnement à l’obtention de certifications ;
Un team de développeurs soudés et choisis parmi les meilleurs passionnés ;
Un environnement 100 agile basé sur les bonnes pratiques Scrum, DevOps et Lean ;
