Job Description

L’objectif de l’équipe ? Concevoir et réaliser la vitrine digitale de notre client, via la production de plusieurs plateformes web (B2B, B2C, etc), en traduisant fidèlement les exigences de nos interlocuteurs via des stories actionnables par les développeurs.
Votre défi : savoir accompagner les stakeholders dans la formulation de leurs besoins et les formaliser sous forme d’un customer journey fidèle à la vision du client et compréhensible à la fois par le business et la technique.
Au quotidien, vous êtes le référent de l’équipe sur les aspects fonctionnels. Vous analysez les besoins utilisateurs, vous les formalisez avant de proposer les solutions les mieux adaptées.
Vision Produit Web
Vous élaborez la vision du Produit pour le MVP et les versions futures, en collaboration avec le Product Owner ;
Vous récoltez les besoins métiers, les attentes et retours utilisateurs tout en les challengeant avec les opportunités du marché ;
Vous identifiez les fonctionnalités attendues et sélectionnez celles qui apportent le plus de valeurs ou de bénéfices aux utilisateurs pour définir et planifier les releases/versions du Produit ;
Vous vérifiez la viabilité du Produit sur le marché ;
Vous validez la vision avec les décideurs et communiquez la vision à l’équipe de conception et de réalisation.
Conception Produit Web
Vous conduisez une réflexion stratégique préparatoire des versions à venir.
Réalisation Produit Web
Vous accompagnez le PO dans la priorisation de toutes les stories au sein du Product Backlog (TFS);
Vous cherchez en permanence à maximiser la valeur métier pour les utilisateurs ;
Vous répondez aux demandes de clarification émises par l’équipe de réalisation sur les Story en cours de réalisation durant les différentes itérations ;
Vous réalisez ou organisez le déroulement des Tests Utilisateurs/Métier de la version ;
Vous évaluez le fonctionnement des versions au fur et à mesure de leurs mises en production;
Vous communiquez sur l’avancement de la réalisation du produit auprès de vos différents interlocuteurs.

Qualifications

Vous avez une expérience de 3 ans minimum en tant que Product Owner ou Business Analyst.
Compétences métier
Vous avez une expérience solide en conception et modélisation d’architecture fonctionnelle web et mobile;
Vous êtes en capacité de concevoir et animer des ateliers d’expression de besoins utilisateurs ;
Vous êtes à l’aise avec la préparation et la conduite de réunions ;
Vous maîtrisez les méthodes, normes et outils de conception ainsi que le maquettage d’applications.
Vous maîtrisez l'anglais écrit et oral
Compétences comportementales
Vous avez des capacités leadership et un excellent relationnel ;
Vous avez un esprit de synthèse ;
Vous faites preuve de rigueur au quotidien ;
Vous êtes empathique et savez travailler en équipe

