L’École des Ponts ParisTech est un établissement d’enseignement supérieur et de recherche dans le domaine des sciences, des usages et de l’économie pour répondre aux enjeux du développement durable. Sous tutelle du Ministère de la transition écologique et solidaire et sous statut d’EPSCP (Établissement public à caractère scientifique, culturel et professionnel), ses missions concernent la formation initiale et continue, la recherche, la diffusion des connaissances, le transfert vers les secteurs économiques et l’aide à la création d’entreprises. Ses activités s’inscrivent sur le plan national et international.
Avec un effectif de 450 personnes, elle est principalement organisée autour de trois pôles : Formation (1800 étudiants, 1000 intervenants), Recherche (12 unités) et Services support.
Depuis sa création en 1747, la plus ancienne école d’ingénieurs ne cesse d’être à la pointe de l’innovation dans l’organisation et le contenu des cursus, en liaison permanente avec une recherche d’un niveau d’excellence reconnu et qu’elle veut porteuse de valorisation.

En son sein, la direction de la documentation a une mission de diffusion des connaissances. Elle est organisée en 3 pôles d’activité :
Le pôle ressources pédagogiques est chargé des ressources et services à destination des étudiants et des enseignants. Il conduit les formations à la recherche documentaire. Il valorise les productions académiques de l’École via une activité d’édition.
Le pôle IST est chargé des services à destination des chercheurs, de la valorisation des publications issues de la recherche, de veille. Il réalise des analyses bibliométriques à destination de la direction de l’École et des laboratoires.
Le pôle patrimoine assure la conservation et la valorisation du fonds ancien, la production et la diffusion de contenus numériques issus des collections patrimoniales, les services aux chercheurs et à tout public intéressé par l’histoire des sciences et par le patrimoine de l’École.
Descriptif des fonctions
Rattachée à la direction de la documentation, le/la responsable des services et projets numériques occupe une position transversale commune aux trois pôles. Il/Elle a trois missions principales :
Structuration des plateformes web, normalisation des données et web éditorial de la direction de la documentation (60 %)
Administrer les applications de bibliothèque numérique patrimoine.enpc.fr et bibliothequedesphares.fr ;
Piloter le projet « Gallica Marque Blanche » en liaison avec la Bibliothèque nationale de France, la direction des systèmes d’information de l’École, le responsable Fonds ancien et la responsable archives ;
Conduire les projets numériques du service : évolution du portail documentaire Cadic, création d’une plateforme web magazine pour les éditions ; définition des spécifications fonctionnelles et organisationnelles, conception des maquettes, mise en œuvre en lien avec les développeurs et webdesigners externes ou internes, amélioration du signalement/référencement (annuaires, réseaux professionnels) ;
Veiller à la normalisation des données exposées sur les réservoirs documentaires de l’École des Ponts : conduire les chantiers de normalisation des données en lien étroit avec la responsable du catalogue, le responsable du fonds ancien, l’ABES et la BnF
Assurer la coordination du web éditorial des pages internet et intranet de la DirDOC, le community management du compte twitter de la bibliothèque ;
Coordination des projets d’édition numérique (20 %)
Participer à la définition de la stratégie éditoriale : valorisation des travaux des élèves et des doctorants par les yearbooks et annuels ; édition numérique de manuels d’enseignement et de ressources pédagogiques ; édition en open access d’ouvrages de référence dans les domaines de compétence de l’École ;
Concevoir et mettre en place des outils et plateformes de diffusion des éditions ;
Répondre à des appels à projets visant à soutenir l’édition scientifique ;
Encadrer la chargée d’édition.
Chargée des ressources et services pédagogiques dans les domaines de l’innovation, de la gestion des entreprises, de l’entreprenariat et du génie industriel (15 %)
Être responsable des acquisitions et de l’indexation de ressources pédagogiques dans ces domaines en lien étroit avec les responsables académiques et les enseignants du département ;
Animer des actions de formation à la méthodologie de recherche documentaire et à l’utilisation d’outils type Endnote, à destination des étudiants des départements ; concevoir des livrets documentaires et produits de veille adaptés aux programmes
Autres missions (5%)
Permanences de service public et d’information aux usagers.

