Passionné par le développement, vous avez réalisé diverses applications telles que des applications Java/web, net./web/Python et/ou Javascript React.js ou Angular, des applications mobiles sur IOS, Android, Windows Phone ou Mobile ainsi que des applications QT et/ou Xamarin.

Le développement de serveurs vous intéresse autant que le développement clients. De plus, vous êtes très curieux concernant les aspects du Cloud et vous observez continuellement les tendances des frameworks.

