Job Description

Le poste est à pourvoir dans la DSI du Siège International d’Ubisoft à Paris, et plus particulièrement au sein de l’équipe chargée des projets IT liés à la finance. Le mandat de cette équipe est de créer les meilleurs outils/solutions IT possibles pour tous les collaborateurs de la fonction Finance d’Ubisoft dans le monde.
En tant que IT Business Analyst votre rôle sera de faire le lien entre les équipes métiers de la Finance et les équipes techniques (développeurs notamment) pour transformer les besoins métiers en solutions (applications, outils, sites web…) efficaces et durables. Vous aurez à cœur de comprendre et challenger les besoins métiers avec rigueur.
À ce titre, vos missions seront les suivantes :
Participez activement aux études de cadrage en amont de l’implémentation d’un outil : définition des règles de gestion et processus métiers de vos clients internes (contrôle de gestion, consolidation ;
Garantir le paramétrage fonctionnel de la solution retenue (PeopleSoft) en collaboration avec les équipes de développement ;
Participer aux phases de test d’intégration, de formation et de recette utilisateur (définition de la stratégie et du plan de test, déroulement des cas de tests, communication avec les utilisateurs, suivi de l’avancement…) ;
Rédiger la documentation utilisateur et participer au partage de connaissances avec nos équipes Support ERP en interne.
Fournir des reportings réguliers d’activité aux projects managers.
Etre en charge de de l’analyse d’impact des nouvelles demandes sur le schéma IT existant ;
Ponctuellement, vous pourrez également intervenir sur d’autres projets (ex : gestion des royauté) en fonction de l’actualité du domaine Finance.

Qualifications

Background
Diplôme supérieur en informatique, école de commerce, d’ingénieur ou équivalent ;
Expérience de minimum 3 ans sur des projets IT au sein d’un cabinet de conseil, et/ou d’un département IT ou Finance.
Compétences requises
Connaissance d’un ERP Finance ;
Excellente capacité à traduire des besoins métiers en solutions IT ;
Maîtrise des différentes phases d’un projet IT : recueil de besoin, rédaction des spécifications, suivi, test, formation des utilisateurs… ;
Expérience dans un contexte international ;
Anglais courant impératif : une partie des équipes ne parle pas français.
Compétences Bonus
Connaissance de PeopleSoft ;
Intérêt pour le domaine du jeu vidéo.

